@manyspaceships 1) The reporters in my case didn't even know my name until I was out of the country. They could not help me.

2) The Intercept didn't exist in 2013.

3) Only six people accessed Winner's report at NSA. Of those six, only Winner's email account had contacted The Intercept.

The government cast Manning into a dungeon for resisting a scheme to make publishers of news subject to the Espionage Act. They offered to let her out in exchange for collaboration, but she chose her principles instead. 

That is moral strength.

